import React, { useState } from 'react';

export default class Results extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    let bcbp = this.props.values
    return (
      <div>

        {Object.keys(bcbp).map(key => 
          <p value={key}>{bcbp[key]}</p>
        )}


      </div>
    );
  }
}
